import React from 'react';
import { NavLink } from 'react-router-dom';
import web from "./image/img1.png"
import Common from "./Common"

const Home=()=>{
    return(
        <>
        <Common name="Grow Your Business Now" imgsrc={web} visit='/service' 
        btname="Contact Now"/>
        </>
    )
}
export default Home;
